type BigNumberish = BigNumber | Bytes | bigint | string | number;
interface BigNumber {
    readonly _hex : string;
    readonly _isBigNumber : boolean;
    fromTwos : (value : number) => BigNumber;
    toTwos : (value : number) => BigNumber;
    abs : () => BigNumber;
    add : (other : BigNumberish) => BigNumber;
    sub : (other : BigNumberish) => BigNumber;
    div : (other : BigNumberish) => BigNumber;
    mul : (other : BigNumberish) => BigNumber;
    mod : (other : BigNumberish) => BigNumber;
    pow : (other : BigNumberish) => BigNumber;
    and : (other : BigNumberish) => BigNumber;
    or : (other : BigNumberish) => BigNumber;
    xor : (other : BigNumberish) => BigNumber;
    mask : (value : number) => BigNumber;
    shl : (value : number) => BigNumber;
    shr : (value : number) => BigNumber;
    eq : (other : BigNumberish) => boolean;
    lt : (other : BigNumberish) => boolean;
    lte : (other : BigNumberish) => boolean;
    gt : (other : BigNumberish) => boolean;
    gte : (other : BigNumberish) => boolean;
    isNegative : () => boolean;
    isZero : () => boolean;
    toNumber : () => number;
    toBigInt : () => bigint;
    toString : () => string;
    toHexString : () => string;
    toJSON : (key? : string) => any;
}

type Address = string & { __Address__ : never };
type TransactionHash = string & { __TransactionId__ : never };

type ContractNumber = BigNumber | number;
type CN<T> = ContractNumber | T;

